// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Deadstreet {
    struct Comment {
        address commenter;
        string content;
        uint256 timestamp;
    }

    struct PasteVersion {
        string content;
        uint256 timestamp;
    }

    struct Paste {
        PasteVersion[] versions;
        address owner;
        uint256 upvotes;
        string[] tags;
        string category;
        Comment[] comments;
    }

    struct Follower {
        address follower;
        bool isFollowing;
    }

    struct Message {
        address sender;
        string content;
        uint256 timestamp;
    }

    mapping(uint256 => Paste) public pastes;
    mapping(uint256 => bool) public pasteExists;
    mapping(uint256 => mapping(address => bool)) public hasUpvoted;
    mapping(address => mapping(address => Follower)) public followers;
    mapping(address => mapping(address => Message[])) public privateChats;
    uint256 public pasteCount;

    event PasteCreated(uint256 indexed pasteId, address indexed owner, string content, uint256 timestamp);
    event PasteDeleted(uint256 indexed pasteId, address indexed owner);
    event PasteUpvoted(uint256 indexed pasteId, address indexed upvoter);
    event CommentAdded(uint256 indexed pasteId, address indexed commenter, string content);
    event PasteEdited(uint256 indexed pasteId, address indexed owner, string newContent, uint256 timestamp);
    event PasteForked(uint256 indexed originalPasteId, uint256 indexed newPasteId, address indexed owner);
    event UserFollowed(address indexed follower, address indexed followee);
    event MessageSent(address indexed sender, address indexed receiver, string content, uint256 timestamp);

    constructor() {
        pasteCount = 0;
    }

    function createPaste(string memory _content, string[] memory _tags, string memory _category) public {
        require(bytes(_content).length > 0, "Content cannot be empty");
        Paste storage newPaste = pastes[pasteCount];
        newPaste.versions.push(PasteVersion({content: _content, timestamp: block.timestamp}));
        newPaste.owner = msg.sender;
        newPaste.upvotes = 0;
        newPaste.tags = _tags;
        newPaste.category = _category;
        pasteExists[pasteCount] = true;
        emit PasteCreated(pasteCount, msg.sender, _content, block.timestamp);
        pasteCount++;
    }

    function editPaste(uint256 _pasteId, string memory _newContent) public {
        require(_pasteId < pasteCount, "Paste ID does not exist");
        require(pasteExists[_pasteId], "Paste has been deleted");
        require(pastes[_pasteId].owner == msg.sender, "Only the owner can edit this paste");

        Paste storage paste = pastes[_pasteId];
        paste.versions.push(PasteVersion({content: _newContent, timestamp: block.timestamp}));
        emit PasteEdited(_pasteId, msg.sender, _newContent, block.timestamp);
    }

    function forkPaste(uint256 _pasteId, string memory _newContent) public {
        require(_pasteId < pasteCount, "Paste ID does not exist");
        require(pasteExists[_pasteId], "Paste has been deleted");

        Paste storage originalPaste = pastes[_pasteId];
        createPaste(_newContent, originalPaste.tags, originalPaste.category);

        emit PasteForked(_pasteId, pasteCount - 1, msg.sender);
    }

    function followUser(address _userToFollow) public {
        require(_userToFollow != msg.sender, "You cannot follow yourself");

        followers[msg.sender][_userToFollow].follower = msg.sender;
        followers[msg.sender][_userToFollow].isFollowing = true;

        emit UserFollowed(msg.sender, _userToFollow);
    }

    function sendMessage(address _recipient, string memory _content) public {
        require(bytes(_content).length > 0, "Message content cannot be empty");

        privateChats[msg.sender][_recipient].push(Message({
            sender: msg.sender,
            content: _content,
            timestamp: block.timestamp
        }));

        emit MessageSent(msg.sender, _recipient, _content, block.timestamp);
    }

    function getPaste(uint256 _pasteId) public view returns (
        string memory content, 
        address owner, 
        uint256 upvotes, 
        string[] memory tags, 
        string memory category, 
        uint256 commentCount
    ) {
        require(_pasteId < pasteCount, "Paste ID does not exist");
        require(pasteExists[_pasteId], "Paste has been deleted");
        Paste storage paste = pastes[_pasteId];
        return (
            paste.versions[paste.versions.length - 1].content, 
            paste.owner, 
            paste.upvotes, 
            paste.tags, 
            paste.category, 
            paste.comments.length
        );
    }

    function deletePaste(uint256 _pasteId) public {
        require(_pasteId < pasteCount, "Paste ID does not exist");
        require(pasteExists[_pasteId], "Paste has already been deleted");
        require(pastes[_pasteId].owner == msg.sender, "Only the owner can delete this paste");

        delete pastes[_pasteId];
        delete pasteExists[_pasteId];
        emit PasteDeleted(_pasteId, msg.sender);
    }

    function upvotePaste(uint256 _pasteId) public {
        require(_pasteId < pasteCount, "Paste ID does not exist");
        require(pasteExists[_pasteId], "Paste has been deleted");
        require(!hasUpvoted[_pasteId][msg.sender], "You have already upvoted this paste");

        pastes[_pasteId].upvotes++;
        hasUpvoted[_pasteId][msg.sender] = true;
        emit PasteUpvoted(_pasteId, msg.sender);
    }

    function addComment(uint256 _pasteId, string memory _content) public {
        require(_pasteId < pasteCount, "Paste ID does not exist");
        require(pasteExists[_pasteId], "Paste has been deleted");
        require(bytes(_content).length > 0, "Comment cannot be empty");

        Comment memory newComment = Comment({
            commenter: msg.sender,
            content: _content,
            timestamp: block.timestamp
        });

        pastes[_pasteId].comments.push(newComment);
        emit CommentAdded(_pasteId, msg.sender, _content);
    }

    function getComments(uint256 _pasteId) public view returns (Comment[] memory) {
        require(_pasteId < pasteCount, "Paste ID does not exist");
        require(pasteExists[_pasteId], "Paste has been deleted");
        return pastes[_pasteId].comments;
    }

    function getMessages(address _withUser) public view returns (Message[] memory) {
        return privateChats[msg.sender][_withUser];
    }
}
